              <ul>
                <li></li>
                <li></li>
                <li></li>
              </ul>
            </div>
          </div>

          <div className="card">
            <div className="card-header registered-guilds">
              <h4>Guilds</h4>
              </div>
            {/* guilds belong to here  */}
            <div className="card-body">
              <ul>
                <li></li>
                <li></li>
                <li></li>
              </ul>

            </div>
          </div>

          </div>
      </main>
    )
  }

}

export default Profile;
